  outlines Refuge accomplishments from January through April of 1943. The report begins
  by summarizing the weather conditions and water conditions during this period. Wildlife-
  including migratory birds and furbearers- is also covered. The Refuge development
  and maintenance section discusses physical developments. The public relations section
  of the report describes Refuge visitors. N-R forms are attached.\",\n\t\"owner_org\":
